import X from './assets/twitter-black.webp';
import Discord from './assets/discord-black.webp';
import Github from './assets/github-black.webp';
import Telegram from './assets/telegram-black.webp';
import Forum from './assets/forum-black.webp';
import Reddit from './assets/reddit-black.webp'

const socials = [
    {
        icon: {X},
        social: 'X',
        slogan: 'Read the latest'
    },
    {
        icon: {Discord},
        social: 'Discord',
        slogan: 'Get involved'
    },
    {
        icon: {Github},
        social: 'Github',
        slogan: 'Build with us'
    },
    {
        icon: {Telegram},
        social: 'Telegram',
        slogan: 'Read the latest'
    },
    {
        icon: {Forum},
        social: 'Forum',
        slogan: 'Read Updates'
    },
    {
        icon: {Reddit},
        social: 'Reddit',
        slogan: 'See more'
    }
]

export default socials
